    return (
        <div className="bottom-mobile">
            <IconContext.Provider value={{ color: "#fff", className: "global-class-name", size: "25px" }}>
                <div className="">
                    <AiFillHome/><p>Home</p>
                </div>
             </IconContext.Provider>
        </div>
    )
}
